import React, { Component } from 'react';

class FormList extends Component {
    constructor(props) {
        super(props)
        this.state = {
            isAdmin: props.isAdmin
        }
    }
    render() {
        console.log(this.state.isAdmin)
        return (
            <div>
                <h2>Page en construction</h2>
            </div>
        );
    }
}

export default FormList;
